import { 
    Row,
    Form,
    Col
} from 'react-bootstrap';
import PropTypes from 'prop-types';

function GaleriaImagens(props) {
    return ( 
        <div>
            {props.imagens.map(imagem => 
                <Form.Group 
                    as={Row} >
                    <Form.Label
                            column
                            md={2}>
                            Galeria:
                    </Form.Label>
                </Form.Group>
            )}
        </div>
    );
}

GaleriaImagens.propTypes = {
    visivel: PropTypes.bool.isRequired,
    imagens: PropTypes.array.isRequired
}

export default GaleriaImagens;
